Add realm.ignoreKotlinNullability

To disable treating kotlin non-null types as @Required.
From v3.6.0, all the kotlin RealmModel's non-null field will be set as
required in the schema. However it is a breaking change for the kotlin
project which has a Realm file created before 3.6.0.

To disable this behaviour introduced in 3.6.0, add below things to the
project's build.gradle:

kapt {
  arguments {
    arg("realm.ignoreKotlinNullability", true)
  }
}

Close #5412

Fix a bug that RealmList.delete*() does not delete target objects (#5234)

* added test cases exposing #5233

* make RealmList.delete*() delete target objects.

This commit requires to applky following patch to Object Store.

diff --git a/src/list.cpp b/src/list.cpp
index 1734cfa..d8aa1e2 100644
--- a/src/list.cpp
+++ b/src/list.cpp
@@ -349,6 +349,16 @@ void List::swap(size_t ndx1, size_t ndx2)
         m_table->swap_rows(ndx1, ndx2);
 }

+void List::delete_(size_t row_ndx)
+{
+    verify_in_transaction();
+    verify_valid_row(row_ndx);
+    if (m_link_view)
+        m_link_view->remove_target_row(row_ndx);
+    else
+        m_table->remove(row_ndx);
+}
+
 void List::delete_all()
 {
     verify_in_transaction();
diff --git a/src/list.hpp b/src/list.hpp
index a3b52af..db4e8d4 100644
--- a/src/list.hpp
+++ b/src/list.hpp
@@ -77,6 +77,7 @@ public:
     void remove(size_t list_ndx);
     void remove_all();
     void swap(size_t ndx1, size_t ndx2);
+    void delete_(size_t list_ndx);
     void delete_all();

     template<typename T = RowExpr>

* Fixed a bug that RealmList.deleteFromRealm(int), RealmList.deleteFirstFromRealm() and RealmList.deleteLastFromRealm() did not remove target objects from Realm. This bug was introduced in 3.7.1 (#5233).

* Fix tests

@NotNull as alias for @Required (#5161)

This PR adds support for org.jetbrains.annotations.NotNull as an alias for @Required. This means that Realm now understands the Kotlin type-system in the Realm schema.

Previously we reported an error if you did @Required RealmList<MyType> list = new RealmList<>();. It is a bit unclear why, since a RealmList is always non-null on managed objects. Since it made the interop with Kotlin kinda strange, I made a change so you can now do @Required RealmList<MyType> list = new RealmLis<>() as well as val list : RealmList<MyType> = RealmList();

After this change it is no longer possible to do val person : Person either, you have to do val person : Person?. This reflects the constraints of Realm, but if people are able to maintain the variant themselves (hint: not possible when using sync), then they can use a custom non-null getter.

